Expand description

An iterator that knows its exact length.

Many [`Iterator`](trait.Iterator.html "trait std::iter::Iterator")s donâ€™t know how many times they will iterate, but some do. If an iterator knows how many times it can iterate, providing access to that information can be useful. For example, if you want to iterate backwards, a good start is to know where the end is.

When implementing an `ExactSizeIterator`, you must also implement [`Iterator`](trait.Iterator.html "trait std::iter::Iterator"). When doing so, the implementation of [`Iterator::size_hint`](about:blank/trait.Iterator.html#method.size_hint "method std::iter::Iterator::size_hint") _must_ return the exact size of the iterator.

The [`len`](about:blank/trait.ExactSizeIterator.html#method.len "method std::iter::ExactSizeIterator::len") method has a default implementation, so you usually shouldnâ€™t implement it. However, you may be able to provide a more performant implementation than the default, so overriding it in this case makes sense.

Note that this trait is a safe trait and as such does _not_ and _cannot_ guarantee that the returned length is correct. This means that `unsafe` code **must not** rely on the correctness of [`Iterator::size_hint`](about:blank/trait.Iterator.html#method.size_hint "method std::iter::Iterator::size_hint"). The unstable and unsafe [`TrustedLen`](trait.TrustedLen.html "trait std::iter::TrustedLen") trait gives this additional guarantee.

## [Â§](#when-shouldnt-an-adapter-be-exactsizeiterator)When _shouldnâ€™t_ an adapter be `ExactSizeIterator`?

If an adapter makes an iterator _longer_, then itâ€™s usually incorrect for that adapter to implement `ExactSizeIterator`. The inner exact-sized iterator might already be `usize::MAX`\-long, and thus the length of the longer adapted iterator would no longer be exactly representable in `usize`.

This is why [`Chain<A, B>`](struct.Chain.html "struct std::iter::Chain") isnâ€™t `ExactSizeIterator`, even when `A` and `B` are both `ExactSizeIterator`.

