Returns the exact remaining length of the iterator.

The implementation ensures that the iterator will return exactly `len()` more times a [`Some(T)`](about:blank/option/enum.Option.html#variant.Some "variant std::option::Option::Some") value, before returning [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None"). This method has a default implementation, so you usually should not implement it directly. However, if you can provide a more efficient implementation, you can do so. See the [trait-level](trait.ExactSizeIterator.html "trait std::iter::ExactSizeIterator") docs for an example.

This function has the same safety guarantees as the [`Iterator::size_hint`](about:blank/trait.Iterator.html#method.size_hint "method std::iter::Iterator::size_hint") function.

